import './categoriaGastoMensal.css';
import React, { useEffect, useState } from 'react';
import GastoCard from '../Components/GastoCard';


const CategoriaGastoMensal = () => {

    const [loading, setLoading] = useState(false);

    if (loading) {
        return <p>Loading...</p>;
    }

    var descricao = "Descricao";
    var data = "11/11/2022";
    var preco = "R$80,00";

    const array = Array(10).fill(0);

  return(
    <div className='wrapper-categoria-mensal'>
        <div className='titulo-categoria'>Alimentação</div>
        <div class="row">
            <div class="col-lg-3">
            {array.map((num, index) => (
                <GastoCard descricao={descricao} preco={preco} data={data}/>
            ))}
            </div>
        </div>
    </div>
  );

};
export default CategoriaGastoMensal;


function CardColumn() {
    const array = Array(10).fill(0);

    return ( 
      <div className="row card-column-tatuadorList">
        {array.map((num, index) => (
          <Card key={index} email={card.email} name={card.name} type="type2" img={card.foto_perfil} clientEmail={clientEmail}/>
        ))}
      </div>
    );
}
